sub GET_GP_FILE {		#START GET_GP_FILE



my (@array_each_line_file, $array_each_line_file);
@array_each_line_file = split(/\n/,$_[0]);



foreach $array_each_line_file (@array_each_line_file) {		#start foreach line file
$array_each_line_file =~ s/^\s+//g;
if ($array_each_line_file !~ m/^\#/) {
$array_each_line_file =~ s/\;.*$//g;
#$array_each_line_file =~ s/\"/\\"/g;
$array_each_line_file =~ s/\"//g;

if ($array_each_line_file) {
$array_each_line_file =~ s/POWER_BOOST\=3dB,3dB,3dB,3dB/POWER_BOOST\=\'\"\"3dB,3dB,3dB,3dB\"\"\'/g;
$array_each_line_file =~ s/POWER_BOOST\=OFF,OFF,OFF,OFF/POWER_BOOST\=\'\"\"OFF,OFF,OFF,OFF\"\"\'/g;
print (BATCH_FILE_VBS "xsh.Screen.send \"cmd $eNB_NAME $array_each_line_file\"\n");
print (BATCH_FILE_VBS "xsh.Screen.Send VbCr\n");
print (BATCH_FILE_VBS "xsh.Session.Sleep 3000\n");
                           }



                                     }

                                                      }		#end foreach line file







               }		#END GET_GP_FILE


