my $STATUS_AFTER_HO_FAILURE = $hash_C1XRTT_ECSFB{$CELL_NUM}{$CARRIER_INDEX}{'STATUS_AFTER_HO_FAILURE'};

my $STRING = "CHG-C1XRTT-ECSFB:$hash_CELL_NUM_INFO{$CELL_NUM},$CARRIER_INDEX,$NUM1_X_PN,$PILOT_STRENGTH_THRESHOLD,$STATUS_AFTER_HO_FAILURE";

print (BATCH_FILE_VBS "xsh.Screen.send \"cmd $eNB_NAME $STRING\"\n");
